import React from 'react'
import { useNavigate } from 'react-router-dom';


function Home() {

    const navigate = useNavigate();
    
    const handleCert =(event) => {
        event.preventDefault();
        navigate('/certificates')
    }
    const handleStudent =(event) => {
        event.preventDefault();
        navigate('/students')
    }

    return (
        <div  className='d-flex justify-content-center align-items-center bg-light vh-100'>
            <div className='border border-dark p-4 rounded w-x d-flex justify-content-center align-items-center bg-light'>
                <div className='d-flex'>
                <h1>Bienvenido(a)</h1>
                </div>
                <div className='d-flex'>
                    <form onSubmit={handleCert}>
                        <button>Certificados</button>
                    </form>
                </div>
                <div>
                    <form onSubmit={handleStudent}>
                        <button>Alumnos</button>
                    </form>
                </div>
                <button>Salir</button>
            </div>
        </div>
    )
}

export default Home
